// src/Downloads.js
import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import { fs } from '@react-native-async-storage/async-storage';
import './App.css';
import appLogo from './assets/summarease.png';
import companyLogo from './assets/creme_brulee.jpg';
import { Link } from 'react-router-dom';
import SearchBar from './SearchBar';


function Downloads() {
  const location = useLocation();
  const [selectedMode, setSelectedMode] = useState(null);
  const [processing, setProcessing] = useState(false);
  const [result, setResult] = useState(null);

  // Get files from state if available
  const files = location.state?.files || [];

  const handleProcess = async (mode) => {
    if (!files.length) {
      alert('No files available to process');
      return;
    }

    setSelectedMode(mode);
    setProcessing(true);

    try {
      // Process each file
      for (const file of files) {
        const fileType = file.name.split('.').pop().toLowerCase();

        // Create a temporary file
        const tempFilePath = `/tmp/${file.name}`;
        const blob = await file.arrayBuffer();
        await fs.writeFile(tempFilePath, Buffer.from(blob));

        // Process the file based on type and mode
        if (fileType === 'pdf') {
          await processPDF(tempFilePath, mode);
        } else if (fileType === 'mp4' || fileType === 'avi' || fileType === 'mov') {
          await processVideo(tempFilePath, mode);
        }
      }

      // Get result from text_output.py
      const result = await getProcessingResult(mode);
      setResult(result);

    } catch (error) {
      console.error('Error processing files:', error);
      alert('Error processing files. Please try again.');
    } finally {
      setProcessing(false);
    }
  };

  const processPDF = async (filePath, mode) => {
    const { exec } = require('child_process');
    return new Promise((resolve, reject) => {
      exec(`python3 text_output.py ${filePath} ${mode}`, (error, stdout, stderr) => {
        if (error) {
          reject(error);
        } else {
          resolve(stdout);
        }
      });
    });
  };

  const processVideo = async (filePath, mode) => {
    // Add video processing logic here
    await new Promise(resolve => setTimeout(resolve, 2000));
  };

  const getProcessingResult = async (mode) => {
    // Add logic to get the processing result
    // This will depend on how your text_output.py returns results
    return new Promise(resolve => setTimeout(() => resolve('Processing complete!'), 1000));
  };

  return (
    <div className="App">
      <div className="background-logo" style={{ backgroundImage: `url(${companyLogo})` }} />

		<header className="app-header">
		  <div style={{ display: 'flex', alignItems: 'center' }}>
			<img src={appLogo} alt="App Logo" className="header-logo" />
			<SearchBar />
		  </div>
		  <nav className="nav-menu">
			<Link to="/" className="nav-item">Home</Link>
			<Link to="/downloads" className="nav-item">Downloads</Link>
			<Link to="/history" className="nav-item">User History</Link>
		  </nav>
		</header>

      <main className="content">
        <h1>Here are some things you can download to help:</h1>

        {processing ? (
          <div className="processing">
            <h2>Processing files...</h2>
            <p>Please wait while we process your files.</p>
          </div>
        ) : selectedMode ? (
          <div className="result">
            <h2>Results:</h2>
            <p>{result}</p>
            <button 
              className="btn eraser pink" 
              onClick={() => setSelectedMode(null)}
            >
              Back to Menu
            </button>
          </div>
        ) : (
          <div className="buttons">
            <button 
              className="btn eraser pink" 
              onClick={() => handleProcess(1)}
              disabled={processing}
            >
              üìÑ Get Summary
            </button>
            <button 
              className="btn eraser blue" 
              onClick={() => handleProcess(2)}
              disabled={processing}
            >
              ‚ùì Get QnA
            </button>
            <button 
              className="btn eraser green" 
              onClick={() => handleProcess(3)}
              disabled={processing}
            >
              üß† Get Quizzes
            </button>
          </div>
        )}
      </main>
    </div>
  );
}

export default Downloads;
